				var rawData = new String;
var cun_rawData = new String;
var projectValues = new Array
var ogslData = new Array;
var cunData = new Array;
var sigla = new Array;

function loadOGSL() {
    loadProjectValues()

    let url = "https://raw.githubusercontent.com/oracc/osl/master/00lib/osl.asl";
    let xhr = new XMLHttpRequest();
    xhr.open("GET", url, true);

    xhr.onreadystatechange = function(ev) {
        if (xhr.readyState === 4) {
            if (xhr.status === 200) {
                rawData = xhr.responseText
            }
        }
    }

    xhr.onerror = function(err) {
        console.warn(err);
    };

    xhr.open("GET", url);
    xhr.send();


    let cun_url = "https://raw.githubusercontent.com/tosaja/Nuolenna/master/sign_list.txt";
    let cun_xhr = new XMLHttpRequest();
    cun_xhr.open("GET", cun_url, true);

    cun_xhr.onreadystatechange = function(ev) {
        if (cun_xhr.readyState === 4) {
            if (cun_xhr.status === 200) {
                cun_rawData = cun_xhr.responseText
            }
        }
    }

    cun_xhr.onerror = function(err) {
        console.warn(err);
    };

    cun_xhr.open("GET", cun_url);
    cun_xhr.send();

}

function loadProjectValues() {
    let url = "https://raw.githubusercontent.com/oeyvind-bjoeru/AkkEC/main/sign_values/akkec_ur3akk.txt";
    let xhr = new XMLHttpRequest();
    xhr.open("GET", url, true);

    xhr.onreadystatechange = function(ev) {
        if (xhr.readyState === 4) {
            if (xhr.status === 200) {
                projectValues = xhr.responseText.split("\n");
            }
        }
    }

    xhr.onerror = function(err) {
        console.warn(err);
    };

    xhr.open("GET", url);
    xhr.send();
}

function pressSubmit() {
    document.getElementById("searchBox").onkeypress = function(event) {
        if (event.keyCode === 13) {
            searchDict()
        }
    };
}

function searchDict() {
    var dictValues = new Object;
    var dictSigns = new Object;

    var cunPairs = new Array;

    let searchTerm = document.getElementById("searchBox").value.toLowerCase();

    searchTerm = searchTerm.replace("x", "ₓ");
    searchTerm = searchTerm.replace("'", "ʾ");

    let subscripts = ["₀", "₁", "₂", "₃", "₄", "₅", "₆", "₇", "₈", "₉"]
    for (let i = 0; i != 10; i++) {
        searchTerm = searchTerm.replace(i.toString(), subscripts[i]);
    }

    ogslData = rawData.split("\n");

    var currentSign = new String;
    var currentBorger = new String;
    var currentUCode = new String;

    for (var i = 0; Math.sign(ogslData.length - i) != 0; i++) {
        let siglum = ogslData[i].split(/\s+/, 1)[0];
        let value = ogslData[i].split(/\s+/, 2)[1];
        sigla.push(siglum);

        if (siglum == '@sign') {
            currentSign = ogslData[i].split(/\s+/, 2)[1];
        } else if (siglum == '@v') {

            if (ogslData[i].split(/\s+/, 2)[1] == '%akk') {
                currentValue = ogslData[i].split(/\s+/, 3)[2];
            } else {
                currentValue = ogslData[i].split(/\s+/, 2)[1];
            }

            dictValues[currentValue] = {
                sign: currentSign,
                borger: currentBorger
            };

            if (currentSign in dictSigns) {
                dictSigns[currentSign].push(currentValue);
            } else {
                dictSigns[currentSign] = [currentValue];
            }

        } else if (value != null) {
            if (siglum == '@list') {
                if (value.slice(0, 3) == 'MZL') {
                    currentBorger = parseInt(value.slice(3, value.length));
                }
            } else if (ogslData[i] == '@end sign') {
                currentSign = '';
                currentValue = '';
                currentBorger = '';
            }
        }
    }

    cunData = cun_rawData.split("\n");

    for (var i = 0; Math.sign(cunData.length - i) != 0; i++) {
        let cun_val = cunData[i].split(/\s+/, 1)[0];
        let cun_sign = cunData[i].split(/\s+/, 2)[1];
        cunPairs[cun_val] = cun_sign;
    }

    if (searchTerm in dictValues) {
        projectMatches = new Array;

        for (var j = 0; Math.sign(projectValues.length - j) != 0; j++) {
            if (dictSigns[dictValues[searchTerm].sign].includes(projectValues[j])) {
                projectMatches.push(projectValues[j])
            }
        }

        if (projectMatches.length == 0) {
            projectMatches.push("–");
        }

        if (dictValues[searchTerm].borger.length == 0) {
            dictValues[searchTerm].borger = "–"
        }

        var newP = document.createElement("p");
        newP.innerHTML = "
Sign:\t" + dictValues[searchTerm].sign + "
MZL:\t" + dictValues[searchTerm].borger + "
Values:\t" + dictSigns[dictValues[searchTerm].sign].join(', ');
        document.getElementById("result").innerHTML = "";
        document.getElementById("result").appendChild(newP);

        if (searchTerm in cunPairs) {

            var pOB1 = document.createElement("p");
            pOB1.innerHTML = cunPairs[searchTerm];
            document.getElementById("sign_ob1").innerHTML = "";
            document.getElementById("sign_ob1").appendChild(pOB1);

            var pOB2 = document.createElement("p");
            pOB2.innerHTML = cunPairs[searchTerm];
            document.getElementById("sign_ob2").innerHTML = "";
            document.getElementById("sign_ob2").appendChild(pOB2);

            var pOB3 = document.createElement("p");
            pOB3.innerHTML = cunPairs[searchTerm];
            document.getElementById("sign_ob3").innerHTML = "";
            document.getElementById("sign_ob3").appendChild(pOB3);

            var pOB4 = document.createElement("p");
            pOB4.innerHTML = cunPairs[searchTerm];
            document.getElementById("sign_ob4").innerHTML = "";
            document.getElementById("sign_ob4").appendChild(pOB4);

            var pNA = document.createElement("p");
            pNA.innerHTML = cunPairs[searchTerm];
            document.getElementById("sign_na").innerHTML = "";
            document.getElementById("sign_na").appendChild(pNA);

